  const [isOpen, setIsOpen] = useState(false)
  const toggle = () => {
    setIsOpen(!isOpen)
  }
  return (
    <Router>
      <Sidebar isOpen={isOpen} toggle={toggle}/>
      <Navbar toggle={toggle}/>
      {/* <Switch>
        <Route path="/:page" component={PageRenderer} />
        <Route path="/" render={()=> <Redirect to="/home" />} />
